import React from "react";
import './maisvendidos.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import macarrao from '../../imagens/prato de macarrao.png';

const slides = [
    {
      image: "image1.jpg",
      title: "Prato 1",
      description: "Descrição do Prato 1"
    },
    // {
    //   image: "image2.jpg",
    //   title: "Prato 2",
    //   description: "Descrição do Prato 2"
    // },

];


function MaisVendidos(){
    return (
        <section className="sec5__maisVendidos">
            <h2>Pratos mais vendidos</h2>
            <div className="sec5__pratos">
                <Swiper
                    spaceBetween={50}
                    slidesPerView={3}
                    onSlideChange={() => console.log('slide change')}
                    onSwiper={(swiper) => console.log(swiper)}
                    >
                    {slides.map((slide, index) => (
                        <SwiperSlide key={index} className="">
                            <img src={macarrao} className="slide__imagem"></img>
                        </SwiperSlide>
                    ))}
                </Swiper>
            </div>
        </section>
    )
}

export default MaisVendidos;
